import React, { Component } from 'react';


class Privacy extends Component {


  render() {

    return (
      <section>
      <h1>Policies</h1>
      <ul>
        <li>
          <a href="https://app.termly.io/document/privacy-policy/f83a3a02-644a-4fa0-bd68-0067d7053a4c" alt= "privacy">Privacy</a></li>

        <li>
          <a href="https://app.termly.io/document/terms-and-conditions/ad22332b-08eb-450d-8f60-bbb433b375c6" alt= "Terms and Conditions">Terms and Conditions</a></li>
          <li>
          <a href="https://app.termly.io/document/disclaimer/d832c07f-8577-46c5-86a8-a8f26e8a8fe2" alt= "Disclaimer">Disclaimer</a></li>
          <li>

          <a href="https://app.termly.io/document/cookie-policy/6811f760-c1ba-4397-93f1-15dbb6a86306" alt= "Disclaimer"><i class="fas fa-cookie"></i></a></li>



      </ul>
      </section>

    )
  }
}
export default Privacy;
